import React from 'react';
import "./homepage.css"


const Homepage = () => {

    return (
        <>
            <div
                className="col-md-4 col-xs-12"
                style={{
                    backgroundImage: `url("https://res.cloudinary.com/uploadfiles/image/upload/v1615496472/WhatsApp_Image_2021-03-10_at_16.56.19_jf63xd.jpg")})`,
                    backgroundPosition: 'center',
                    backgroundSize: 'cover',
                    backgroundRepeat: 'no-repeat',
                }}
            />
        </>
    )

}

export default Homepage;
